import styled from 'styled-components';
import bgImg from '../assets/background.png';

const HomeContainer = styled.div`
  width: 440px;
  height: 956px;
  display: flex;
  align-items: center;
  justify-content: center;
  background: #f5f5f5;
`;

const CardContainer = styled.div`
  position: relative;
  width: 440px;
  height: 956px;
  border-radius: 5px;
  overflow: hidden;
  box-shadow: 0 4px 20px rgba(0,0,0,0.1);
  background: #fff;
  display: flex;
  flex-direction: column;
`;

const BackgroundImage = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 0;
  background-image: url(${props => props.bg});
  background-size: cover;
  background-position: center;
`;

const Content = styled.div`
  position: relative;
  z-index: 1;
  width: 100%;
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  padding: 40px 32px 22px 22px;
  box-sizing: border-box;
`;

const TopText = styled.div`
  color: #222;
  font-family: Pretendard;
  font-size: 28px;
  font-style: normal;
  font-weight: 600;
  letter-spacing: -0.84px;
  line-height: 140%;
  text-align: left;
  margin-top: 110px;
  margin-bottom: 15px;
  width: 100%;
  position: relative;
`;

const InfoRow = styled.div`
  display: flex;
  gap: 12px;
  align-items: center;
  margin-bottom: 16px;
`;

const InfoBox = styled.div`
  background: rgba(255,255,255,0.2);
  border-radius: 20px;
  padding: 11px 11px;
  color: #222;
  font-size: 14px;
  font-family: Pretendard;
  font-weight: 400;
`;

const StatusBox = styled(InfoBox)`
  color: #4ecdc4;
  background: rgba(76,205,196,0.12);
`;


const Message = styled.div`
  color: #234E83;
  font-family: Pretendard;
  font-size: 36px;
  font-weight: 250;
  line-height: 140%;
  letter-spacing: -1.08px;
  margin: 38px 0 24px 0;
  text-align: left;
  width: 100%;
`;

const WeatherSection = styled.div`
  position: absolute;
  bottom: 140px;
  right: 90px;
  display: flex;
  flex-direction: row;
  margin: 0 0 27px 268px;
  align-items: flex-end;
  z-index: 1;
`;

const TempSection = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
`;

const Location = styled.div`
  color: #222;
  font-family: Pretendard;
  font-size: 16px;
  font-weight: 500;
  margin-bottom: 4px;
`;

const Temp = styled.div`
  color: #222;
  font-family: Pretendard;
  font-size: 128px;
  font-weight: 600;
  line-height: 1;
`;

const TempRange = styled.div`
  color: #888;
  font-family: Pretendard;
  font-size: 16px;
  font-weight: 400;
`;

const BottomButton = styled.button`
  position: absolute;
  left: 50%;
  bottom: 167px;
  transform: translateX(-50%);
  width: 340px;
  height: 48px;
  border-radius: 24px;
  background: #b3d8f7;
  color: #222;
  font-family: Pretendard;
  font-size: 18px;
  font-weight: 500;
  border: none;
  cursor: pointer;
`;

export default function Home() {
  return (
    <HomeContainer>
      <CardContainer>
        <BackgroundImage bg={bgImg} />
        <Content>
          <TopText>
            햇살이 반가운 날도 있지만,<br />
            비 오는 날엔 느긋해도 괜찮아요.
          </TopText>
          <InfoRow>
            <InfoBox>25.05.15</InfoBox>
            <InfoBox>AM 11:00</InfoBox>
            <StatusBox>보통</StatusBox>
          </InfoRow>
          <Message>
            비가 먼저 나가서<br />
            기다리고 있어요.<br />
            <span style={{fontWeight:400}}>우산 꼭 챙겨서 만나요!</span>
          </Message>
          <WeatherSection>
            <TempSection>
              <Location>안산시 상록구 | 비</Location>
              <Temp>17°</Temp>
              <TempRange>16  20</TempRange>
            </TempSection>
          </WeatherSection>
          <BottomButton>
            오늘의 마음의 색상을 등록해주세요.
          </BottomButton>
        </Content>
      </CardContainer>
    </HomeContainer>
  );
}
